/// @author viko
/// @notice 
contract Vote{
    /// @notice 
    address owner;

    /// @notice 14
    uint votingPeriodLength = 14 days;

    /// @notice 
    uint clearingVotingPeriodLehgth = 7 days;

    /// @notice eth
    Proposal[] proposalQueue;

    /// @notice 
    ClearingProposal[] clearingProposalQueue;

    /// @notice 
    Proposal_Common[] commonProposalQueue;

    /// @notice 
    mapping(uint256=>uint256) clearingValue;

    /// @notice 
    uint256 totalClearingVlaue;

    /// @notice 
    FundPool public fundPool;

    /// @notice 
    //address public projectFactoryAddress;

    /// @notice   
    ClearingProposal public cur_clearingProposal;

    /// @notice 
    uint256 public proposalFee = 10 finney; //0.01eth

    /// @notice eth
    struct Proposal{
        uint256 index;//
        string proposalName; //
        address proposer; //
        uint256 approveVotes; //
        uint256 refuseVotes; //
        uint256 startTime; //
        address recipient; //gas
        uint256 value; //
        uint256 timeConsuming; // 30
        bool process; //
        bool pass; //
        bool abort;//
        bool oneTicketRefuse;//
        mapping(address => enumVoteResult) voteDetails;
        string detail; //
        Tap tap;
    }

    /// @notice 
    struct Proposal_Common{
        uint256 index;//
        string proposalName; //
        address proposer; //
        uint256 approveVotes; //
        uint256 refuseVotes; //
        uint256 startTime; //
        bytes execScript; //bytes
        address execContract; //contract
        bool process; //
        bool pass; //
        bool abort;//
        bool oneTicketRefuse;//
        mapping(address => enumVoteResult) voteDetails;
        string detail; //
    }

    /// @notice 
    struct ClearingProposal{
        uint256 index;
        mapping(address => uint256) clearingList;//
        uint256 startTime;//
        address proposer;//
        uint256 totalShares;//
        bool pass; //
        bool process; //
    }

    /// @notice 
    struct Tap{
        uint256 startTime;
        uint256 endTime;
        uint256 totalMoney;
    }

    /// @notice 
    enum enumVoteResult {
        waiver,
        approve,
        refuse
    }

    /* events */
    /// @param index proposalName proposer startTime recipient value timeConsuming ,detail 
    event OnApplyProposal(
        uint256 index,
        string proposalName,
        address proposer,
        uint256 startTime,
        address recipient,
        uint256 value,
        uint256 timeConsuming,
        string detail
    );

    /// @param index proposalName proposer startTime execScript  ,execContrac 
    event OnApplyCommonProposal(
        uint256 index,
        string proposalName,
        address proposer,
        uint256 startTime,
        bytes execScript,
        address execContract
    );

    /// @param who  ,proposalType index ,voteResult shares 
    event OnVote(
        address who,
        uint8 proposalType,
        uint256 index,
        uint8 voteResult,
        uint256 shares
    );

    /// @param index proposalType , pass 
    event OnProcess(
        uint256 index,
        uint8 proposalType,
        bool pass
    );

    /// @param index ,proposalType 
    event OnAbort(
        uint256 index,
        uint8 proposalType
    );

    /// @param index ,proposalType 
    event OnOneTicketRefuse(
        uint256 index,
        uint8 proposalType
    );

    /// @param index getMoney totalMoney getTime 
    event OnGetMoney(
        uint256 index,
        uint256 getMoney,
        uint256 totalMoney,
        uint256 getTime
    );

    /// @param proposer ,startTime 
    event OnApplyClearingProposal(
        uint256 index,
        address proposer,
        uint256 startTime
    );

    /// @param who ,shares 
    event OnVoteClearingProposal(
        uint256 index,
        address who,
        uint256 shares
    );

    /// @param proposer ,startTime ,totalShares ,pass 
    event OnProcessClearingProposal(
        uint256 index,
        address proposer,
        uint256 startTime,
        uint256 totalShares,
        bool pass
    );

    event OnTest(address u);

    /// @notice 
    modifier isOwner() {
        require(owner == msg.sender, "limited authority");
        _;
    }

    modifier ownShares() {
        require(getSharesOf(msg.sender)>0, "need has shares");
        _;
    }

    constructor() public{
        owner = msg.sender;
    }

    /// @notice vote
    function unsafe_setFundPool(FundPool _fundPool) public{
        require(address(fundPool) == address(0),"first init");
        fundPool = _fundPool;
    }

    /// @notice 
    function getLengthOfProposalQueue() public view returns(uint256){
        return proposalQueue.length;
    }

    /// @notice index
    /// @param proposalIndex 
    function getProposalInfoByIndex(uint256 proposalIndex) public view returns(
        string memory,
        address,
        uint256,
        address,
        uint256,
        uint256,
        string memory details
    )
    {
        Proposal memory proposal = proposalQueue[proposalIndex];
        return(
            proposal.proposalName,
            proposal.proposer,
            proposal.startTime,
            proposal.recipient,
            proposal.value,
            proposal.timeConsuming,
            proposal.detail
            );
    }

    /// @notice index
    /// @param proposalIndex 
    function getProposalStateByIndex(uint256 proposalIndex) public view returns(
        uint256,
        uint256,
        bool,
        bool,
        bool,
        bool
    )
    {
        Proposal memory proposal = proposalQueue[proposalIndex];
        return(proposal.approveVotes,proposal.refuseVotes,proposal.process,proposal.pass,proposal.abort,proposal.oneTicketRefuse);
    }

    /// @notice 
    /// @param proposalIndex 
    function getTapByIndex(uint256 proposalIndex) public view returns(
        uint256 startTime,
        uint256 endTime,
        uint256 money
    )
    {
        Proposal memory proposal = proposalQueue[proposalIndex];
        startTime = proposal.tap.startTime;
        endTime = proposal.tap.endTime;
        money = proposal.tap.totalMoney;
    }

    /// @notice 
    /// @param _address 
    function getSharesOf(address _address)
    public
    view
    returns(uint256){
        address who = _address;
        if(who == address(0))
            who = msg.sender;
        return fundPool.balances(who);
    }

    /// @notice 
    /// @param _name _recipient _value _timeConsuming _detail 
    function applyProposal(
        string memory _name,
        address _recipient,
        uint256 _value,
        uint256 _timeConsuming,
        string memory _detail
    )
        public
        payable
        ownShares()
    {
        require(_recipient != address(0),"_recipient cannot be null");
        require(_value>0,"value need more than 0");
        require(_timeConsuming>=0,"_timeConsuming cant less than 0");
        //gas
        require(msg.value == proposalFee, "need proposalFee");
        Proposal memory proposal = Proposal({
            index : proposalQueue.length,
            proposalName : _name,
            proposer : msg.sender,
            approveVotes : 0,
            refuseVotes : 0,
            startTime : now,
            recipient : _recipient,
            value : _value,
            timeConsuming : _timeConsuming,
            process : false,
            pass : false,
            abort : false,
            oneTicketRefuse : false,
            detail : _detail,
            tap : Tap({startTime:0,endTime:0,totalMoney:0})
        });
        emit OnApplyProposal(
            proposal.index,
            proposal.proposalName,
            proposal.proposer,
            proposal.startTime,
            proposal.recipient,
            proposal.value,
            proposal.timeConsuming,
            proposal.detail
        );
        proposalQueue.push(proposal);
    }

    /// @notice 
    /// @param proposalIndex 
    function abortProposal(uint256 proposalIndex) public ownShares(){
        //
        require(proposalIndex<proposalQueue.length,"proposal does not exist");
        Proposal storage proposal = proposalQueue[proposalIndex];
        //
        require(proposal.proposer == msg.sender,"sender should be proposer");
        //
        require(now <= proposal.startTime + votingPeriodLength,"time out");
        //
        require(proposal.oneTicketRefuse == false,"proposal has been oneTicketRefuse");
        //
        require(proposal.abort == false,"proposal has been aborted");
        proposal.abort = true;
        emit OnAbort(proposalIndex,2);
    }

    /// @notice 
    /// @dev 
    /// @param proposalIndex 
    function oneTicketRefuseProposal(uint256 proposalIndex) public ownShares() {
        //
        require(owner == msg.sender,"sender should be owner");
        //
        require(proposalIndex<proposalQueue.length,"proposal does not exist");
        Proposal storage proposal = proposalQueue[proposalIndex];
        //
        require(proposal.abort == false,"proposal has been aborted");
        //
        require(proposal.oneTicketRefuse == false,"proposal has been oneTicketRefuse");

        proposal.oneTicketRefuse = true;
        emit OnOneTicketRefuse(proposalIndex,1);
    }

    /// @notice 
    /// @param proposalIndex result 
    function vote(uint256 proposalIndex,uint8 result) public ownShares() {
        //
        require(proposalIndex<proposalQueue.length,"proposal does not exist");
        Proposal storage proposal = proposalQueue[proposalIndex];
        //
        require(now <= proposal.startTime + votingPeriodLength,"time out");
        //
        require(proposal.voteDetails[msg.sender] == enumVoteResult.waiver,"Votes have been cast");
        //
        require(result == 1||result == 2,"vote result must be less than 3");
        //
        require(proposal.abort == false,"proposal has been aborted");
        //
        require(proposal.oneTicketRefuse == false,"proposal has been oneTicketRefuse");
        //
        enumVoteResult voteResult = enumVoteResult(result);
        proposal.voteDetails[msg.sender] = voteResult;
        //
        uint256 shares = getSharesOf(msg.sender);
        //
        require(shares > 0,"shares need more 0");
        if(voteResult == enumVoteResult.approve){
            proposal.approveVotes = proposal.approveVotes + shares;
        }
        else{
            proposal.refuseVotes = proposal.refuseVotes + shares;
        }
        emit OnVote(msg.sender,1,proposalIndex,result,shares);
    }

    /// @notice 
    /// @param proposalIndex 
    function process(uint256 proposalIndex) public {
        //
        require(proposalIndex<proposalQueue.length,"proposal does not exist");
        Proposal storage proposal = proposalQueue[proposalIndex];
        //
        require(now > proposal.startTime + votingPeriodLength,"it's within the expiry date");
        //
        require(proposal.process == false,"proposal has been process");
        //
        require(proposal.abort == false,"proposal has been aborted");
        //
        require(proposal.oneTicketRefuse == false,"proposal has been oneTicketRefuse");
        proposal.process = true;
        //
        msg.sender.transfer(proposalFee);
        //
        if(proposal.approveVotes>proposal.refuseVotes){
            proposal.pass = true;
            // 
            Tap memory tap = Tap({
                startTime : now,
                endTime : now + proposal.timeConsuming * 1 days,
                totalMoney : proposal.value
            });
            proposal.tap = tap;
        }
        emit OnProcess(proposalIndex,1,proposal.pass);
    }

    /// @notice 
    /// @param proposalIndex 
    function getMoney(uint256 proposalIndex) public {
        //
        require(proposalIndex<proposalQueue.length,"proposal does not exist");
        Proposal storage proposal = proposalQueue[proposalIndex];
        //
        require(proposal.pass == true,"proposal does not pass");
        //
        require(msg.sender == proposal.recipient,"sender must be recipient");
        Tap memory tap = proposal.tap;
        require(tap.totalMoney > 0,"no money");
        //
        uint256 times = (now - tap.startTime) / 1 days;
        uint256 allTimes = (tap.endTime - tap.startTime) / 1 days;
        uint256 canGetMoney = allTimes == 0?tap.totalMoney: tap.totalMoney / allTimes * times;
        require(canGetMoney < address(this).balance,"not enough money");
        proposal.tap.startTime = tap.startTime + (times * 1 days);
        proposal.tap.totalMoney -= canGetMoney;
        require(tap.totalMoney >= 0,"tap.totalCanMoney cant less than 0");
        msg.sender.transfer(canGetMoney);
        emit OnGetMoney(proposalIndex,canGetMoney, proposal.tap.totalMoney,now);
    }
